import { About, Header, Hero } from "./components";
import "./styles/global.css";

function App() {
  return (
    <div className="App bg-black text-white px-5">
      <Header className="fixed" />
      <Hero />
      <About className="mt-20" />
    </div>
  );
}

export default App;
